import React, { Component } from 'react';
import { Div, Div3 } from '../styles/styles';

class InterfaceRegistro extends Component {
    render() {
        return (
            <Div>
            <Div3>
                <H1>Explore new courses</H1>
         
                <P>Study and watch all our new courses
                and there are many of them</P>
            </Div3>
            </Div>
        );
    }
}

export default InterfaceRegistro;
